Hi, I have the same problem. 
When I try to use:

import { Tensor, InferenceSession } from "onnxruntime-web";
const url = "./models/model.onnx";
const session = await InferenceSession.create(url, {executionProviders: ['wasm'], });

I get the following error:
backend-impl.js:81 Uncaught (in promise) Error: no available backend found. ERR: [wasm] RuntimeError: abort(CompileError: WebAssembly.instantiate(): expected magic word 00 61 73 6d, found 3c 21 44 4f @+0). Build with -s ASSERTIONS=1 for further information


To use onnxruntime-web I used: npm i onnxruntime-web
To use this backend, do I need to configure or import any other file/s in my project?

Thank you for your attention.
To make it easy to replicate what I have done is to start a project from scratch, to make it easier to explain all the steps and configurations.

1. I have created a React project using: npx create-react-app my-app
2. I installed the 'onnxruntime-web' package: npm i onnxruntime-web
3. I installed the following packages: npm install react-app-rewired wasm-loader -D and created a config-overrides.js file (so I never modify the default webpack configuration as created with CRA) with the following configuration:

const path = require('path');
module.exports = function override(config, env) {
  const wasmExtensionRegExp = /\.wasm$/;
  config.resolve.extensions.push('.wasm');
  config.module.rules.forEach(rule => {
    (rule.oneOf || []).forEach(oneOf => {
      if (oneOf.loader && oneOf.loader.indexOf('file-loader') >= 0) {
        // make file-loader ignore WASM files
        oneOf.exclude.push(wasmExtensionRegExp);
      }
    });
  });
  // add a dedicated loader for WASM
  config.module.rules.push({
    test: wasmExtensionRegExp,
    include: path.resolve(__dirname, 'src'),
    use: [{ loader: require.resolve('wasm-loader'), options: {} }]
  });
  return config;
};


