6. To run it I use either "npm run start" or first "npm run build" and then "serve -s build".

==========

Result:
 + If I use "const session = InferenceSession.create(url, { executionProviders: ['webgl'] });"  loads the model without any problem. 
 + If I use "const session = InferenceSession.create(url);" first generate some warnings, but then load the model, because it uses "webgl"
 + If I force to use "wasm" : const session = InferenceSession.create(url, {executionProviders: ['wasm']}); . It generate this error: https://ibb.co/tCp6Qv1


If I check browser's devtool the URL requeris for the .wasm file is: http://localhost:3000/static/js/ort-wasm-simd.wasm
But that file is not there in that route if I look in the "sourcetree"

The model I have to run if I use "webgl" does not have certain operators, so I needed to use "wasm". What am I doing wrong?
I guess I'm not loading the .wasm files, but I don't know how to fix it.
